import React from 'react'
import playstore from "../../../resources/playstore.png";
import Appstore from "../../../resources/Appstore.png";
import "./Footer.css";
const Footer = () => {
    return (
       <footer id = "footer">
           <div className= "leftfooter">
               <h4>DOWNLOAD OUR APP</h4>
               <p>Download App for Androide and IOS mobile phone</p>
               <img src={playstore} alt="Playstore"/>
               <img src={Appstore} alt="Appstore"/>
           </div>

           <div className ="midfooter">
               <h1>LvTs-Tracker</h1>
               <p>We manage your leaves </p>
           </div>

           <div className="rightfooter">
               <h4>Developed By:</h4>
               <a href='https://www.linkedin.com/in/ayush-chadha-a71b08159'>AYUSH_CHADHA</a>
               <a href='https://www.linkedin.com/in/harman-singh-virdi28'>HARMAN_SINGH</a>
           </div>

       </footer>
    );
}

export default Footer
